import './Moviecard.css'

function Moviescard(object) {
    return (
        <div>
            <p>{object.titleCard}</p>
            <p>{object.year}</p>
            <p>{object.director}</p>
            <p>{object.duration}</p>
            <p>{object.genre}</p>
            <p>{object.rate}</p>
        </div>
    )
}

export default Moviescard;
